A pervasive issue in existing Rust is the sandwich problem. It occurs when a type passed into an operation wants to perform control flow not supported by the type it's passed into. Thus creating a sandwich [7] The classic example is a map operation: Not to be confused with the higher-order sandwich dilemma which is when you look at the sandwich problem and attempt to determine whether the sandwich is two slices of bread with a topping in between, or two toppings with a slice of bread in between. Imo the operation part of the problem feels more bready , but that would make for a weird-looking sandwich. Ergo: sandwich dilemma. (yes, you can ignore all of this.) enum Option<T> { Some(T), None,
} impl<T> Option<T> { fn map<J>(self, f: impl FnOnce(T) -> J) -> Option<J> { ... }
} my_option.map(|x| x.await) This will produce a compiler error: the closure f is not an async context, so .await cannot be used within it. And we can't just convert the closure to be async either, since fn map doesn't know how to call async functions. In order to solve this issue, we could provide a new async_map method which does provide an async closure. But we may want to repeat those for more effects, and that would result in a combinatorial explosion of effects. Take for example "can fail" and "can be async": not async async infallible fn map fn async_map fallible fn try_map fn async_try_map That's a lot of API surface for just a single method, and that problem multiplies across the entire API surface in the stdlib . We expect that once we start applying "keyword generics" to traits, we will be able to solve the sandwich problem. The type f would be marked generic over a set of effects, and the compiler would choose the right variant during compilation.

