The base of Effect Generic Trait Declarations is the ability to declare traits as being generic over effects. This RFC currently only considers the async effect, but should be applicable to most other effects (modulo unsafe and const, more on that later). The way a trait is defined is by adding a #[maybe(effect)] notation. This signals that a trait may be implemented as carrying the effect. For example, a version of the Read trait which may or may not be async would be defined as: #[maybe(async)]
pub trait Read { #[maybe(async)] fn read(&mut self, buf: &mut [u8]) -> Result<usize>;
}

104.body:
Traits can be implemented as either async or non-async. The trait-level #[maybe(async)] can be thought of as a const-generic bool which determines the value of the method-level #[maybe(async)] declarations. So if a trait is implemented as async, all methods tagged as #[maybe(async)] have to be async too. /// The base implementation
impl Read for Reader { fn read(&mut self, buf: &mut [u8]) -> Result<usize> { // ... }
} /// The async implementation
impl async Read for AsyncReader { async fn read(&mut self, buf: &mut [u8]) -> Result<usize> { // ... }
}

