At the MIR level the lowering of #[maybe(effect)] is shared with const, and is essentially implemented via const generic bools. Take the following maybe-async definition of Into: // Trait definition
#[maybe(async)]
trait Into<T>: Sized { #[maybe(async)] fn into(self) -> T;
} At the type level the #[maybe(async)] system is lowered to a const bool which determines whether the function should be async. If the trait is implemented as async, the bool is set to true. If it isn't, it's set to false. // Lowered trait definition
trait Into<T, const IS_ASYNC: bool = false>: Sized { type Ret = T; fn into(self) -> Self::Ret;
} By default the const bool is set to false. The return type of the function here is the base return type of the definition: /// The base implementation
impl Into<Loaf> for Cat { fn into(self) -> Loaf { self.nap() }
} // Lowered base trait impl
impl Into<Loaf, false> for Cat { // IS_ASYNC = false type Ret = T; fn into(self) -> Self::Ret { self.nap() }
} However if we implement the async version of the trait things change a little. In the lowering the const bool is set to true to indicate we are in fact async. And in the lowering we wrap the return type in an impl Future, as well as return an anonymous async {} block from the function. /// The async implementation
impl async Into<AsyncLoaf> for AsyncCat { async fn into(self) -> AsyncLoaf { self.async_nap().await }
} // Lowered async trait impl
impl Into<AsyncLoaf, true> for AsyncCat { // IS_ASYNC = true type Ret = impl Future<Output = T>; fn into(self) -> Self::Ret { async move { self.async_nap().await } }
}

