Things become more interesting when lifetimes are involved in the effectful lowering of a trait. The return type of an async fn which takes a reference has to be a future with a lifetime. Which means it's in our lowering our associated type can't be a plain future - it has to be a future with a lifetime attached. And this requires lifetime GATs to work. Say instead of the async version of Into, we tried to write the maybe-async version of AsRef [2] . We could define it as follows: this is just for the purpose of an example; I don't actually know of any cases which want an async version of AsRef. But never say never. /// The trait definition
#[maybe(async)]
pub trait AsRef<T>
where T: ?Sized,
{ #[maybe(async)] fn as_ref(&self) -> &T;
} /// The lowering of the trait definition
pub trait AsRef<T, const IS_ASYNC: bool = false>
where T: ?Sized,
{ type Ret<'a> = &'a T where Self: 'a; fn as_ref(&self) -> Self::Ret<'_>;
} We could then implement it like we did with our Into impl. The non-async impl would look like this: /// The base implementation
impl AsRef<Loaf> for Cat { fn as_ref(&self) -> &Loaf { self.nap_ref() }
} /// Lowering of the base implementation
impl AsRef<Loaf, false> for Cat { // IS_ASYNC = false type Ret<'a> = &'a Loaf where Self: 'a; fn as_ref(&self) -> Self::Ret<'_> { self.nap_ref() }
} And the async implementation would look like this: /// The base implementation
impl async AsRef<Loaf> for AsyncCat { async fn as_ref(&self) -> &Loaf { self.async_nap_ref().await }
} /// Lowering of the base implementation
impl AsRef<AsyncLoaf, true> for AsyncCat { // IS_ASYNC = true type Ret<'a> = impl Future<Output = &'a Loaf> + 'a where Self: 'a; fn as_ref(&self) -> Self::Ret<'_> { async { self.async_nap_ref().await } }
} While effect-generic trait definitions with lifetimes do rely on GATs in their lowering, crucially they don't rely on any potential notion of lifetime-generics to function. The right lifetime GATs can be emitted by the compiler during lowering, and should therefor always be accurate.

