Using effect generic trait definitions in trait bounds should be no problem, assuming the bounds are concrete. Unlike concrete types, generic bounds may implement both effecful and uneffectful implementations for the same bounds as long as they target non-overlapping sets of traits. For example, assuming we had a maybe-async version of Into, introducing a maybe-async version of From would allow us to write the following non-overlapping generic bounds. /// If we also introduce a maybe-async
/// version of the `From` trait‚Ä¶
#[maybe(async)]
pub trait From<T>: Sized { #[maybe(async)] fn from(value: T) -> Self;
} /// ‚Ä¶we can implement the synchronous
/// variant for any type `T, U: From<T>`‚Ä¶
impl<T, U> Into<U> for T
where U: From<T> {} /// ‚Ä¶as well as the asynchronous variant for
/// any type `T, U: async From<T>`.
impl<T, U> async Into<U> for T
where U: async From<T> {} For the purpose of the trait resolver, From and async From should be considered non-overlapping bounds. This is a new capability which we'll need to introduce, and effectively comes down to treating U: From<T, false> and U: From<T, true> as non-overlapping bounds. Effect-generic trait bounds (conditional effects in bounds) are not introduced by this RFC, but may be introduced by a future extension.

