The reason why this RFC is able to write function bodies which are generic over effects is because effects such as async are non-destructive. Adding the async notation to a function does not lose any information - meaning you can arrive at the function signature and body you might had had before simply by removing the async and .await notation. Take this simple async function. It calls the method meow on some type cat, returning String. /// 1. Our base `meow` function
fn meow() -> String { cat.meow()
} Say cat.meow was async instead. We could change our function to support it simply by adding the necessary async and .await notations. /// 2. The async version of `meow`
async fn meow() -> String { cat.meow().await
} Because adding async and .await does not erase any information from the base function, it is non-destructive. Meaning we can always reverse it by removing all the calls to async and .await, arriving back at the function we initially had. /// 3. Stripping the `async/.await` notations
/// yields our base function again
fn meow() -> String { cat.meow()
} Uncarried effects such as const don't require any forwarding notations, and so are by definition non-destructive in their transformation. In addition to async, Rust has two other carried effects: gen and try. Parts of both of these effects are unstable or undecided, but there is no reason we should require their notation to be destructive. Given the unstable nature of these effects, we'll cover them in more detail in the "future possibilities" section of this RFC. effect name forwarding notation desugaring logical return type carried type async .await impl Future<Output = T> T ! try‚Ä† ? impl Try<Output = T, Residual = R>‚Ä† T R gen‚Ä† yield from ‚Ä° impl Iterator<Item = U> () U ‚Ä† These items exist in Rust, but are unstable. ‚Ä° These items have been discussed for inclusion, but have not yet been included on nightly. "logical return type" in this context means: the type the function returns after the function has been evaluated and any forwarding notation has been applied. The "carried type" here refers to the additional types end-users need to be aware of when the effect is introduced. For example, when using the try effect, users will be exposed to additional Result<_, E> or Option types.

