In our previous post we introduced the placeholder async<A> syntax to describe the concept of a "function which is generic over its asyncness". We always knew we wanted something that felt lighter weight than that, so in for our current design we've chosen to drop the notion of a generic parameter for the end-user syntax, and instead picked the ?async notation. We've borrowed this from the trait system, where for example + ?Sized indicates that something may or may not implement the Sized trait. Similarly ?async means a function may or may not be async. We also refer to these as "maybe-async" functions. Time for an example. Say we took the Read trait and the read_to_string_methods . In the stdlib their implementations look somewhat like this today: trait Read { fn read(&mut self, buf: &mut [u8]) -> Result<usize>; fn read_to_string(&mut self, buf: &mut String) -> Result<usize> { ... }
} /// Read from a reader into a string.
fn read_to_string(reader: &mut impl Read) -> std::io::Result<String> { let mut string = String::new(); reader.read_to_string(&mut string)?; Ok(string)
} Now, what if we wanted to make these async in the future? Using ?async notation we could change them to look like this: trait ?async Read { ?async fn read(&mut self, buf: &mut [u8]) -> Result<usize>; ?async fn read_to_string(&mut self, buf: &mut String) -> Result<usize> { ... }
} /// Read from a reader into a string.
?async fn read_to_string(reader: &mut impl ?async Read) -> std::io::Result<String> { let mut string = String::new(); reader.read_to_string(&mut string).await?; Ok(string)
} The way this would work is that Read and read_to_string would become generic over their "asyncness". When compiled for an async context, they will behave asynchronously. When compiled in a non-async context, they will behave synchronously. The .await in the read_to_string function body is necessary to mark the cancellation point in case the function is compiled as async; but when not async would essentially become a no-op [2] : One restriction ?async contexts have is that they can only call other ?async and non-async functions. Because if we could call an always-async function, there would be no clear right thing to do when compiled in non-async mode. So things like async concurrency operations won't directly work in always-async contexts. But we have a way out of this we talk about later in the post: if is_async() .. else ... This allows you to branch the body of a ?async fn based on which mode it's being compiled in, and will allow you to write different logic for async and non-async modes. This means you can choose to use async concurrency in the async version, but keep things sequential in the non-async version. // `read_to_string` is inferred to be `!async` because
// we didn't `.await` it, nor expected a future of any kind.
#[test]
fn sync_call() { let _string = read_to_string("file.txt")?;
} // `read_to_string` is inferred to be `async` because
// we `.await`ed it.
#[async_std::test]
async fn async_call() { let _string = read_to_string("file.txt").await?;
} We expect ?async notation would be most useful for library code which doesn't do anything particularly specific to async Rust. Think: most of the stdlib, and ecosystem libraries such as parsers, encoders, and drivers. We expect most applications to choose to be compiled either as async or non-async, making them mostly a consumer of ?async APIs.

