Now that we've taken a good look at what happens when we can't be generic over effects, it's time we start talking about what we can do about it. The answer, unsurprisingly, is to introduce effect generics into the language. To cover all uses will take a few steps, so let's start with the first, and arguably most important one: effect-generic trait definitions. This is important because it would allow us to introduce effectful traits as part of the stdlib. Which would among other things would help standardize the various async ecosystems around the stdlib. pub trait Into<T>: Sized { fn into(self) -> T;
} impl Into<Loaf> for Cat { fn into(self) -> Loaf { self.nap() }
} Let's use a simple example here: the Into trait. The Into trait is used to convert from one type into another. It is generic over a type T, and has one function "into" which consumes Self and returns the type T. Say we have a type cat which when it takes a nap turns into a cute little loaf. We can implement Into<Loaf> for Cat by calling self.nap in the function body. pub trait AsyncInto<T>: Sized { async fn into(self) -> T;
} impl AsyncInto<Loaf> for Cat { async fn into(self) -> Loaf { self.nap().await }
} But what if the cat doesn't take a nap straight away? Maybe nap should actually be an async function. In order to await nap inside the trait impl, the into method would need to be async. If we were writing an async trait from scratch, we could do this by exposing a new AsyncInto trait with an async into method. But we don't just want to add a new trait to the stdlib, instead we want to extend the existing Into trait to work with the async effect. The way we could extend the Into trait with the async effect is by making the async effect optional . Rather than requiring that the trait is always sync or async, implementors should be able to choose which version of the trait they want to implement. #[maybe(async)]
impl Into<Loaf> for Cat { #[maybe(async)] fn into(self) -> Loaf { self.nap() }
} The way this would work is by adding a new notation on the trait: "maybe async". We don't yet know what syntax we want to use for "maybe async", so in this talk we'll be using attributes. The way the "maybe async" notation works is that we mark all methods which we want to be "maybe async" as such. And then mark our trait itself as "maybe async" too. impl Into<Loaf> for Cat { fn into(self) -> Loaf { self.nap() }
} impl async Into<Loaf> for Cat { async fn into(self) -> Loaf { self.nap().await }
} Implementors then get to choose whether they want to implement the sync or async versions of the trait. And depending on which version they choose, the methods then ends up being either sync or async. This system would be entirely backwards-compatible, because implementing the sync version of Into would remain the same as it is today. But people who want to implement the async version would be able to, just by adding a few extra async keywords to the impl. impl async Into<Loaf> for Cat { async fn into(self) -> Loaf { self.nap().await }
} impl Into<Loaf, true> for Cat { type ReturnTy = impl Future<Output = Loaf>; fn into(self) -> Self::ReturnTy { async move { self.nap().await } }
} Under the hood the implementations desugars to regular Rust code we can already write today. The sync implementation of the type returns a type T. But the async impl returns an impl Future of T. Under the hood it is just a single const bool and some associated types. good diagnostics gradual stabilization, backwards-compatibility clear inference rules It would be reasonable to ask why we're bothering with a language feature, if the desugaring ends up being so simple. And the reason is: effects are everywhere, and we want to make sure effect generics feel like part of the language. That not only means that we want to tightly control the diagnostics. We also want to enable them to be gradually introduced, have clear language rules, and be backwards-compatible. But if you keep all that in mind, it's probably okay to think of effect generics as mostly syntactic sugar for const bools + associated types.

