where R: AsyncRead, W: AsyncWrite; Now what would it look like if we tried adding an async version of this to the stdlib today. Well, we'd need to start by giving it a different name so it doesn't conflict with the existing copy function. The same goes for the trait bounds as well, so instead of taking Read and Write, this function would take AsyncRead and `AsyncWrite. pub fn async_copy<R, W>( reader: &mut R, writer: &mut W
) -> io::Result<()>
where R: async Read, W: async Write; Now things get a little better once we have effect-generic trait definitions. Rather than needing to take async duplicates of the Read and Write traits, the function can instead choose the async versions of the existing Read and Write traits. That's already better, but it still means we have two versions of the copy function. #[maybe(async)]
pub fn copy<R, W>( reader: &mut R, writer: &mut W
) -> io::Result<()>
where R: #[maybe(async)] Read, W: #[maybe(async)] Write; Instead the ideal solution would be to allow copy itself to be generic over the async effect, and make that determine which versions of Read and Write we want. These are what we call "effect-generic bounds". The effect of the function and the effect of the bounds it takes all become the same. In literature this is also known as "row-polymorphism". copy(reader, writer)?; // infer sync
copy(reader, writer).await?; // infer async
copy::<async>(reader, writer).await?; // force async Because the function itself is now generic over the async effect, we need to figure out at the call-site which variant we intended to use. This system will make use of inference to figure it out. That's a fancy way of saying that the compiler is going to make an educated guess about which effects the programmer intended to use. If they used .await they probably wanted the async version. Otherwise they probably wanted the sync version. But as with any guess: sometimes we guess wrong, so for that reason we want to provide an escape hatch by enabling program authors to force the variant. We don't know the exact syntax for this yet, but we assume this would likely be using the turbofish notation. struct File { .. }
impl File { fn open<P>(p: P) -> Result<Self> where P: AsRef<Path>;
} But effect-generics aren't just needed for functions. If we want to make the stdlib work well with effects, then types will need effect-generics too. This might seem strange at first, since an "async type" might not be very intuitive. But for example files on Windows need to be initialized as either sync or async. Which means that whether they're async or not isn't just a property of the functions, it's a property of the type. Let's use the stdlib's File type as our example here. For simplicity let's assume it has a single method: open which returns either an error or a file. struct AsyncFile { .. }
impl AsyncFile { async fn open<P>(p: P) -> Result<Self> where P: AsRef<AsyncPath>;
} If we wanted to provide an async version of File, we again would need to duplicate our interfaces. That means a new type AsyncFile, which has a new async method open, which takes an async version of Path as an argument. And Path needs to be async because it itself has async filesystem methods on it. As I've said before: once you start looking you notice effects popping up everywhere. #[maybe(async)]
struct File { .. } #[maybe(async)] impl File { #[maybe(async)] fn open<P>(p: P) -> Result<Self> where P: AsRef<#[maybe(async)] Path>;
} Instead of creating a second AsyncFile type, with effect generics on types we'd be able to open File as async instead. Allowing us to keep just the one File definition for both sync and async variants. #[maybe(async)]
fn copy<R, W>(reader: R, writer: W) -> io::Result<()> { let mut buf = vec![4028]; loop { match reader.read(&mut buf).await? { 0 => return Ok(()), n => writer.write_all(&buf[0..n]).await?, } }
