So far we've only talked about how we could finish the work on existing effects such as const and async. But one nice thing of effect generics is that they would not only allow us to finish our ongoing effects work. It would also lower the cost of introducing new effects to the language. Which opens up the question: if we could add more effects, which effects might make sense to add? The obvious ones would be to actually finish adding try and generator functions. But beyond that, there are some interesting effects we could explore. For brevity I'll only discuss what these features are, and not show code examples. no-divergence : guarantees that a function cannot loop indefinitely, opening up the ability to perform static runtime-cost analysis. no-panic : guarantees a function will never produce a panic, causing the function to unwind. parametricity : guarantees that a function only operates on its arguments. That means no implicit access to statics, no global filesystem, no thread-locals. capability-safety : guarantees that a function is not only parametric, but can't downcast abstract types either. Say if you get an impl Read, you can't reverse it to obtain a File. destructor linearity : guarantees that Drop will always be called, making it a safety guarantee. pattern types : enables functions to operate directly on variants of enums and numbers must-not-move types : would be a generalization of pinning and the pin-project system, making it a first-class language feature Though there's nothing inherently stopping us from adding any of these features into Rust today, in order to integrate them into the stdlib without breaking backwards-compatibility we need effect generics first. effect const = diverge + panic;
effect core = const + statics + non_determinism;
effect alloc = core + heap;
effect std = alloc + host_apis; This brings us to the final part of the design space: effect aliases. If we keep adding effects it's very easy to eventually reach into a situation where we have our own version of "public static void main". In order to mitigate that it would instead be great if we could name specific sets of effects. In a way we've already done that, where const represents "may loop forever" and "may panic". If we actually had "may loop forever" and "may panic" as built-in effects, then we could redefine const as an alias to those. Fundamentally this doesn't change anything we've talked about so far. It's just that this would syntactically be a lot more pleasant to work with. So if we ever reach a state where we have effect generics and we want notice we maybe have one too many notation in front of our functions, it may be time for us to start looking into this more seriously.

