One of Rust's defining features is the ability to write functions which are generic over their input types. That allows us to write a function once, leaving it up to the compiler to generate the right implementations for us. Rust allows you to be generic over types - it does not allow you to be generic over other things that are usually specified by keywords. For example, whether a function is async, whether a function can fail or not, whether a function is const or not, etc. The post "What color is your function" [2] describes what happens when a language introduces async functions, but with no way to be generic over them: I will take async-await over bare callbacks or futures any day of the week. But we‚Äôre lying to ourselves if we think all of our troubles are gone. As soon as you start trying to write higher-order functions, or reuse code, you‚Äôre right back to realizing color is still there, bleeding all over your codebase. This isn't just limited to async though, it applies to all modifier keywords - including ones we may define in the future. So we're looking to fill that gap by exploring something we call "keyword generics" [3] : the ability to be generic over keywords such as const and async. R. Nystrom, ‚ÄúWhat Color is Your Function?,‚Äù Feb. 01, 2015. https://journal.stuffwithstuff.com/2015/02/01/what-color-is-your-function/ (accessed Apr. 06, 2022). The longer, more specific name would be: "keyword modifier generics". We've tried calling it that, but it's a bit of a mouthful. So we're just sticking with "keyword generics" for now, even if the name for this feature may end up being called something more specific in the reference and documentation. To give you a quick taste of what we're working on, this is roughly how we imagine you may be able to write a function which is generic over "asyncness" in the future: Please note that this syntax is entirely made up, just so we can use something in examples. Before we can work on syntax we need to finalize the semantics, and we're not there yet. This means the syntax will likely be subject to change over time. async<A> trait Read { async<A> fn read(&mut self, buf: &mut [u8]) -> Result<usize>; async<A> fn read_to_string(&mut self, buf: &mut String) -> Result<usize> { ... }
} /// Read from a reader into a string.
async<A> fn read_to_string(reader: &mut impl Read * A) -> std::io::Result<String> { let mut string = String::new(); reader.read_to_string(&mut string).await?; string
} This function introduces a "keyword generic" parameter into the function of A. You can think of this as a flag which indicates whether the function is being compiled in an async context or not. The parameter A is forwarded to the impl Read, making that conditional on "asyncness" as well. In the function body you can see a .await call. Because the .await keyword marks cancellation sites we unfortunately can't just infer them [4] . Instead we require them to be written for when the code is compiled in async mode, but are essentially reduced to a no-op in non-async mode. No really, we can't just infer them - and it may not be as simple as omitting all .await calls either. The Async WG is working through the full spectrum of cancellation sites, async drop, and more. But for now we're working under the assumption that .await will remain relevant going forward. And even in the off chance that it isn't, fallibility has similar requirements at the call site as async does. We still have lots of details left to figure out, but we hope this at least shows the general feel of what we're going for.

