People write duplicate code for async/non-async with the only difference being the async keyword. A good example of that code today is async-std , which duplicates and translates a large part of the stdlib's API surface to be async [6] . And because the Async WG has made it an explicit goal to bring async Rust up to par with non-async Rust , the issue of code duplication is particularly relevant for the Async WG as well. Nobody on the Async WG seems particularly keen on proposing we add a second instance of just about every API currently in the stdlib. Some limitations in async-std apply: async Rust is missing async Drop, async traits, and async closures. So not all APIs could be duplicated. Also async-std explicitly didn't reimplement any of the collection APIs to be async-aware, which means users are subject to the "sandwich problem". The purpose of async-std was to be a proving ground to test whether creating an async mirror of the stdlib would be possible: and it's proven that it is, as far as was possible with missing language features. We're in a similar situation with async today as const was prior to 2018. Duplicating entire interfaces and wrapping them in block_on calls is the approach taken by e.g. the mongodb [ async , non-async ], postgres [ async , non-async ], and reqwest [ async , non-async ] crates: // Async functionality like this would typically be exposed from a crate "foo":
async fn bar() -> Bar { // async implementation goes here
} // And a sync counterpart would typically be exposed from a crate
// named "blocking_foo" or a submodule on the original crate as
// "foo::blocking". This wraps the async code in a `block_on` call:
fn bar() -> Bar { futures::executor::block_on(foo::bar())
} This situation is not ideal. Instead of using the host's synchronous syscalls, we're now going through an async runtime to get the same results - something which is often not zero-cost. But more importantly, it's rather hard to keep both a sync and async API version of the same crate in, err, sync with each other. Without automation it's really easy for the two APIs to get out of sync, leading to mismatched functionality. The ecosystem has come up with some solutions to this, perhaps most notably the proc-macro based maybe-async crate . Instead of writing two separate copies of foo, it generates a sync and async variant for you: #[maybe_async]
async fn foo() -> Bar { ... } While being useful, the macro has clear limitations with respect to diagnostics and ergonomics. That's absolutely not an issue with the crate, but an inherent property of the problem it's trying to solve. Implementing a way to be generic over the async keyword is something which will affect the language in many ways, and a type system + compiler will be better equipped to handle it than proc macros reasonably can.

