Pattern types are an in-progress proposal for Rust to add a limited form of refinement types / liquid types to Rust via pattern the pattern notation. Take for example the existing AtomicBool::load operation. Its signature looks like this: /// A boolean type which can be safely shared between threads.
struct AtomicBool { .. } impl AtomicBool { /// Loads a value from the bool. pub fn load(&self, order: Ordering) -> bool { .. }
} Atomics are part Rust's memory model, and are how we're able to share data between threads. Depending on what we want to do with an atomic, we'll want to give it a different Ordering argument. Ordering is just an enum, which has the following variants: #[non_exhaustive]
pub enum Ordering { Relaxed, Release, Acquire, AcqRel, SeqCst,
} For this example it doesn't exactly matter what each of these variants are for. But what's important is that not all variants are valid arguments for AtomicBool::load. Its documentation says that SeqCst, Acquire, and Relaxed are valid. But if the Release or AcqRel variants are used, it will panic at runtime. Pattern types would in theory enable us to "shift-left" on this, by encoding the allowed variants directly into the function's parameters. This would encode this invariant directly via the type system, meaning we've "shifted left" from a runtime error (e.g. we need to run tests to find the bug), to a compiler error (e.g. we need to run cargo check to find the bug). Using the pattern types draft RFC, this would look something like this: struct AtomicBool { .. }
impl AtomicBool { pub fn load(&self, order: Ordering is Ordering::SeqCst | Ordering::Acquire | Ordering::Relaxed ) -> bool { .. }
}

