On Zulip people have brought up the idea of using editions to resolve these issues. That might be possible, but it would mean a clean break between code written on an older edition, and code written on a newer edition. And while we can leverage editions to change defaults in the language, this kind of break feels like it would push against the intended goal of maintaining compatibility between editions. The idea underlying it seems right though: we do want some way to express modality in our type system. We've already done this before using the const effect. Functions tagged as const can be evaluated either during compilation or at runtime. And it's backwards-compatible to take an existing runtime-only fn and change it to a const fn. fn meow() -> &'static str { "meow" } // 1. The base `fn meow`
const fn meow() -> &'static str { "meow" } // 2. Changing `meow` to a `const fn` is backwards-compatible We could do something very similar with pattern types as well. The base mechanism for this is to define a function which can be compiled in one of two modes: Invariants are evaluated at compile-time : The pattern types are evaluated by the compiler according to the pattern type RFC. A compiler error is raised if the pattern's invariants are violated. Invariants are evaluated at runtime : The pattern types are converted to a sequence of assertions, and evaluated at runtime. The translation here from pattern types to runtime assertions should be fairly mechanical. We could imagine some notation which signals that while a function may declare pattern types, the caller has an option to either evaluate them at runtime or during compilation. Taking our earlier AtomicBool::load example, we could imagine something like this: struct AtomicBool { .. }
impl AtomicBool { #[maybe(pattern_types)] pub fn load(&self, order: Ordering is Ordering::SeqCst | Ordering::Acquire | Ordering::Relaxed ) -> bool { .. }
} With this notation, all existing uses of AtomicBool::load would continue working. But optionally it could be called using pattern types, which would be evaluated at compile-time. Depending on which variant of the function is selected, the lowering of the function would change. Desugared, this would roughly look like this: /// Semantic lowering of `AtomicBool::load`
/// using compile-time checks
pub fn load(&self, order: Ordering is Ordering::SeqCst | Ordering::Acquire | Ordering::Relaxed
) -> bool { .. } /// Semantic lowering of `AtomicBool::load`
/// using runtime assertions
pub fn load(&self, order: Ordering) -> bool { match order { order @ Ordering::SeqCst | Ordering::Acquire | Ordering::Relaxed => .., order => panic!("Expected `Ordering::{{Acquire | Relaxed | SeqCst}}`, received {order}"), }
}

