Feature Name: effect-generic-trait-decls Start Date: (2024-01-01) RFC PR: rust-lang/rfcs#0000 Rust Issue: rust-lang/rust#0000 This RFC introduces Effect-Generic Trait Declarations. These are traits which are generic over Rust's built-in effect keywords such as async. Instead of defining two near-identical traits per effect, this RFC allows a single trait to be declared which is generic over the effect. Here is a variant of the Into trait which can be implemented as either async or not. #[maybe(async)]
trait Into<T>: Sized { #[maybe(async)] fn into(self) -> T;
} Implementers can then choose whether to implement the base version or the effectful version of the trait. If they want the base version they don't include the async effect. If they want the async version they can include the async keyword. /// The base implementation
impl Into<Loaf> for Cat { // The trait is not marked async‚Ä¶ fn into(self) -> Loaf { // and thus neither is the method. self.nap() }
} /// The async implementation
impl async Into<AsyncLoaf> for AsyncCat { // The trait is marked async‚Ä¶ async fn into(self) -> AsyncLoaf { // and thus so is the method. self.async_nap().await }
}
